import React, { Component } from 'react';
import './css/Projects.css'
import CardsProject from './CardsProject';
import { Link } from 'react-router-dom';
// import { project } from '../db'

class Projects extends Component {
  render() {
    const { project } = this.props;
    return (
      <section className="boxSkills">
        { project.map((pro, index) => pro.nome === 'mondodb' ? 
        <div className="boxTech" key={ index }>
          <h4 className="tamanhoc" id="conhecimento"><strong>Conheça meus projetos:</strong></h4>        
          <CardsProject data={ pro } />
          <Link to="/">
            <span>Voltar ao inicio</span>
          </Link>
          <a href={ pro.href }>Repositório</a>
        </div>
        : console.log('não deu')
      )}</section>
  )
  }
}

export default Projects;
